import React, {useEffect} from 'react';
import styled from '@emotion/styled';
import { Link } from "react-scroll";


const Item = styled.p`
    position: fixed;
    width: 100%;
    top: 30px;
    right: 10px;
    text-decoration: none;
    display: block;
    color: #00a3f5;
    text-align: center;
    font-size: 48px;
    text-decoration: none;
    border-radius: 50%;
    border-style: solid;
    border-color: #00a3f5;
    height: 50px;
    width: 50px;
    padding: 10px;
    margin: 10px;
    &:hover {
        background-color: #00a3f5;
        color: white;
        cursor: pointer;
    }
`;

const Navbar=() => {


   return (
    <React.Fragment>
            <Link
                    activeClass="top"
                    to="top"
                    spy={true}
                    smooth={true}
                    offset={-0}
                    duration={500}>
                    <Item><div>^</div></Item>
                    </Link>
        </React.Fragment>
   )
};

export default Navbar;
